import React from 'react';
import './searchresults.css';
import SearchBar from './navbar';

const SearchResults = () => {
    // let hellohello = document.querySelector('hello');
    // hellohello.push(searchResults); 
    // console.log(hellohello); 
    // console.log(searchResults); 

    return (
        <div>
            <div className='to-hide-from-view'>
                <SearchBar />
            </div>
            <div className='to-show-search-results'>
                <p className='hello'></p>
            </div>
        </div>
    )
}

export default SearchResults;
